import { Typography } from "@mui/material";
import { IShippingFields } from "../Types/userForm.interface"
import React, { FC } from "react"

const User: FC = ({name,username,phone,email}:IShippingFields) => {
    return (
        <div>
            <div>{name}</div>
            <div>{username}</div>
            <div>{phone}</div>
            <div>{email}</div>
        </div>
    )
}
export default User;
